import React from 'react';

import './NavBar.css';

const NavBar = (props) => {
    let Home = null;
    let Join = null;
    let Login = null;
    let SignUp = null;

    if(props.displayHome) {
        Home = (
            <li>Home</li>
        );
    }
    if(props.displayJoin) {
        Join = (
            <li>Join</li>
        );
    }
    if(props.displayLogin) {
        Login = (
            <li>Login</li>
        );
    }
    if(props.displaySignUp) {
        SignUp = (
            <li>SignUp</li>
        );
    }

    return (
        <nav className="navBar">
            <ul className="leftPart">
                {Home}
                {Join}
            </ul>
            <ul className="rightPart">
                {Login}
                {SignUp}
            </ul>
        </nav>
    );
};

export default NavBar;
